import React from 'react'
import  Base  from "../core/Base"
import { isAuthenticated } from "../auth/helper/index"
import { Link } from 'react-router-dom';

const AdminDashboard = ( ) =>{
const {
    user: { name, email, role} 
} = isAuthenticated();
// var name="suren"
// var email="g@gmail.com"
// var role

const adminLeftSide = () => {
    return (
        <div className="card">
            <h4 className="card-header bg-dark text-white" >Admin Navigation</h4>
            <ul className="list-group">
                <li className="list-group-item">
                    <Link className="nav-item text-success" to="/admin/create/category">Create Categories</Link>
                </li>
                <li className="list-group-item">
                    <Link className="nav-item text-success" to="/admin/category">Manage Categories</Link>
                </li>
                <li className="list-group-item">
                    <Link className="nav-item text-success" to="/admin/create/product">Create Product</Link>
                </li>
                <li className="list-group-item">
                    <Link className="nav-item text-success" to="/admin/products">Manage Product</Link>
                </li>
                <li className="list-group-item">
                    <Link className="nav-item text-success" to="/admin/orders">Manage order</Link>
                </li>
            </ul>
        </div>
    );
};

const adminRightSide = () =>{
    return (
        <div className="card mb-4">
        <h4 className="card-header">Admin Information</h4>
            <li className="list-group-item" >
                <span className="badge badge-success mr-2" >Name: </span>{name}
            </li>
            <li className="list-group-item" >
                <span className="badge badge-success mr-2" >Email: </span>{email}
            </li>
            <li className="list-group-item" >
                <span className="badge badge-danger mr-2" >Administrater</span>
            </li>
        </div>
    );
};


    return (
        <Base title="Welcome to Admin Area" description="Manage the product from here!" 
        className="container bg-success p-4">

            <div className="row">
                <div className="col-3">{adminLeftSide()}</div>
                <div className="col-9">{adminRightSide()}</div>
            </div>


        </Base>
    )
}

export default AdminDashboard;
